/**
 * @param {number[][]} intervals
 * @return {boolean}
 */
var canAttendMeetings = function(intervals) {
  let sorted = intervals.sort((a, b) => a[0] > b[0]);
  console.log(sorted);
  for (let i = 1; i < sorted.length; i++) {
      if (sorted[i][0] < sorted[i - 1][1]) {
          return false;
      }
  }
  return true;
};

